/**
 * @file
 * Global utilities.
 *
 */
(function ($, Drupal) {
  "use strict";

  Drupal.behaviors.bootstrap_barrio_subtheme = {
    attach: function (context, settings) {
      var position = $(window).scrollTop();
      $(window).scroll(function () {
        if ($(this).scrollTop() > 50) {
          $("body").addClass("scrolled");
        } else {
          $("body").removeClass("scrolled");
        }
        var scroll = $(window).scrollTop();
        if (scroll > position) {
          $("body").addClass("scrolldown");
          $("body").removeClass("scrollup");
        } else {
          $("body").addClass("scrollup");
          $("body").removeClass("scrolldown");
        }
        position = scroll;
      });
      $(document).ready(function () {
        $(".main--menu > a, #desktop-search-icon").html("");
        $(".menu--footer-menu > a, #desktop-search-icon-footer").html("");
      });
      $(".main--menu > a, #desktop-search-icon").bind("click", function (e) {
        e.preventDefault();
        $(this).toggleClass("fa fa-times");
        $(this).toggleClass("fa fa-search");
        $(".header-right div.block-search-form-block.main-menu-search").toggle(
          "slow"
        );
      });
      $(".menu--footer-menu > a, #desktop-search-icon-footer").bind(
        "click",
        function (e) {
          e.preventDefault();
          $(this).toggleClass("fa fa-times");
          $(this).toggleClass("fa fa-search");
          $(
            ".region-footer-third div.block-search-form-block.main-menu-search"
          ).toggle("slow");
        }
      );
      $(document).ready(function () {
        $(".mobile-nav > a, #desktop-search-icon").html("");
      });
      $(".mobile-nav > a, #desktop-search-icon").bind("click", function (e) {
        e.preventDefault();
        $(this).toggleClass("fa fa-times");
        $(this).toggleClass("fa fa-search");
        $("div.mobile-menu-search").toggle("slow");
      });

      //  Replace all 'am' and 'pm' to have periods like 'a.m.' and 'p.m.' and only run the function when on a locations page.  //
      var locationTimes = $(".office-hours").children();

      function replaceText() {
        $(".office-hours__item-slots").text(function (index, text) {
          return text.replace("am", "a.m.");
        });
        $(".office-hours__item-slots").text(function (index, text) {
          return text.replace("pm", "p.m.");
        });
        // Adjust the dash to an en dash for day range e.g. Monday – Friday
        $(".office-hours__item-label").text(function (index, text) {
          return text.replace("-", "–");
        });
      }

      function updateTimes() {
        for (var i = 0; i < locationTimes.length; i++) {
          replaceText();
        }
      }

      // Intro Video modal: Stop playback when closed
      $(document).ready(function () {
        $(".modal").each(function () {
          var src = $(this).find("iframe").attr('src');

          $(this).on("click", function () {
            $(this).find("iframe").attr("src", "");
            $(this).find("iframe").attr("src", src);
          });
        });
      });

      if ($("body").hasClass("node--type-location")) {
        updateTimes();
      }
    },
  };
})(jQuery, Drupal);
;
/**
 * @file
 * better_exposed_filters.js
 *
 * Provides some client-side functionality for the Better Exposed Filters module.
 */

(function ($, Drupal, drupalSettings) {
  Drupal.behaviors.betterExposedFilters = {
    attach: function (context, settings) {
      // Add highlight class to checked checkboxes for better theming.
      $('.bef-tree input[type=checkbox], .bef-checkboxes input[type=checkbox]')
        // Highlight newly selected checkboxes.
        .change(function () {
          _bef_highlight(this, context);
        })
        .filter(':checked').closest('.form-item', context).addClass('highlight');
    }
  };

  /*
   * Helper functions
   */

  /**
   * Adds/Removes the highlight class from the form-item div as appropriate.
   */
  function _bef_highlight(elem, context) {
    $elem = $(elem, context);
    $elem.attr('checked')
      ? $elem.closest('.form-item', context).addClass('highlight')
      : $elem.closest('.form-item', context).removeClass('highlight');
  }

})(jQuery, Drupal, drupalSettings);
;
